import React from "react";
import { Link } from "react-router-dom";
import "./styles.css";

const Home = () => {
  return (
    <div className="home-container">
      <h1 className="home-title">Alzheimer's Disease Detection</h1>
      <img src="/alzheimers_banner.jpg" alt="Alzheimer's Awareness" className="banner-image" />
      <div className="home-buttons">
        <Link to="/about" className="button">About</Link>
        <Link to="/contact" className="button">Contact</Link>
        <Link to="/predict" className="button">Prediction</Link>
      </div>
    </div>
  );
};

export default Home;
